const LogsItem = () => {
    return
    <div className="item">
        {/** date */}
        <div className="date">
            <div className="month">July</div>
            <div className="day">01</div>
        </div>
        {/** content */}
        <div className="content">
            <h2 className="desc">
                Learn SpringBoot
            </h2>
            <div className="time">40 mins</div>
        </div>
    </div>;
};

export default LogsItem;
